import React from 'react'

const Pods = ({ pods }) => {
  return (
    <div>
      <center><h1>Pod List</h1></center>
      {pods.map((data, key) => {
          return (
            <div key={key}>
              {data.metadata}
            </div>
          );
        })}
    </div>
  )
};

export default Pods
